import { ElementTypes } from "../../ElementTypes";
import { Tile } from "../../Tile";


export const loadLevel = (tile:Tile, levelData:any) => {

  levelData.atoms.forEach( (a:any)  => {
    if( ElementTypes.TYPES_MAP.get(a.element) ) {

      tile.getSiteByCoord(a.gridPos).atom = ElementTypes.TYPES_MAP.get(a.element)?.class.CREATE();
    }
  });

  // tile.getSiteByCoord(levelData.playerStart).atom = PLAYER EMITTERs.PLAYER();
  // tile.getSiteByCoord(levelData.goal).atom = Goal.CREATE();

  // levelData.walls.forEach( (w:GridCoord )=> {
  //   tile.getSiteByCoord(w).atom = MembraneWall.SW_XL();
  // })

  // levelData.enemies.forEach( (e:GridCoord )=> {
  //   tile.getSiteByCoord(e).atom = Enemy.CREATE();
  // })
};


